import React from 'react';
import Link from 'next/link';

const Pokemon = ({ pokemon }) => {

    const {name, image, url} = pokemon;

    return (
        <li>
            <h3>
                { name }
            </h3>
            <img src = {image} alt = "Pokemon Image" />
        </li>
    );
}
 
export default Pokemon;
